import React from "react";
import { useGetCryptoHExchangeQuery } from "../services/cryptoApi";
import { Col, Row, Typography } from "antd";

const Exchanges = () => {
  const { data: exchangeList, isFetching } = useGetCryptoHExchangeQuery();
  const exchanges = exchangeList?.data;
  if (isFetching) return "Loading..";

  return (
    <div style={{ padding: "2%", textAlign: "center" }}>
      <div style={{ marginBottom: "5%" }}>
        <Typography.Title level={2}>Statistics</Typography.Title>
      </div>
      <Row gutter={[100, 50]} justify="center">
        <Col>
          <Typography.Title level={4}>Volume</Typography.Title>
          <Typography.Text>{exchanges?.stats?.volume}</Typography.Text>
        </Col>
        <Col>
          <Typography.Title level={4}>Total</Typography.Title>
          <Typography.Text>{exchanges?.stats?.total}</Typography.Text>
        </Col>
        <Col>
          <Typography.Title level={4}>Limit</Typography.Title>
          <Typography.Text>{exchanges?.stats?.limit}</Typography.Text>
        </Col>
      </Row>
      <div>
        <Typography.Title level={2}>Exchanges</Typography.Title>
      </div>
      <Row gutter={[100, 32]}>
        {exchanges.map((exchanges) => (
          <Col>
            <Typography.Text>{exchangeList?.exchanges[0]?.name}</Typography.Text>
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default Exchanges;
